tables.table_schema:
CREATE TABLE solo_travel_visa_requirements (
  country_name VARCHAR(255) NOT NULL,
  visa_requirements TEXT,
  entry_regulations TEXT
);

CREATE TABLE solo_travel_visa_requirements (
    country VARCHAR(255),
    visa_type VARCHAR(255),
    visa_requirements TEXT
);

CREATE TABLE entry_regulations (
    country VARCHAR(255),
    entry_conditions TEXT
);

CREATE TABLE solo_travel_visa_requirements (
   country VARCHAR(255),
   visa_required BOOLEAN,
   duration VARCHAR(50)
);

CREATE TABLE visa_regulations (
   country VARCHAR(255),
   visa_type VARCHAR(50),
   entry_requirements TEXT,
   regulations_url VARCHAR(255)
);

CREATE TABLE visa_applications (
   application_id INTEGER,
   country VARCHAR(255),
   applicant_name VARCHAR(255),
   application_status VARCHAR(50)
);

CREATE TABLE CountryEntryRegulations (
    country_code VARCHAR(2) PRIMARY KEY,
    visitor_type VARCHAR(50),
    entry_restrictions TEXT
);

CREATE TABLE VisaApplicationProcess (
    visa_type VARCHAR(50) PRIMARY KEY,
    application_fee DECIMAL,
    processing_time INT,
    required_documents TEXT
);

CREATE TABLE VisaIssuanceHistory (
    visa_issue_id SERIAL PRIMARY KEY,
    visa_type VARCHAR(50),
    issue_date DATE,
    issued_by VARCHAR(100)
);

CREATE TABLE visa_requirements (
    country_name VARCHAR(255),
    visa_type VARCHAR(255),
    visa_validity VARCHAR(100),
    entry_requirements TEXT
);

CREATE TABLE visa_application_process (
    country_name VARCHAR(255),
    application_requirements TEXT,
    application_process TEXT
);

CREATE TABLE visa_fee (
    country_name VARCHAR(255),
    visa_type VARCHAR(255),
    fee_amount DECIMAL(10, 2),
    fee_currency VARCHAR(3)
);

CREATE TABLE visa_processing_time (
    country_name VARCHAR(255),
    visa_type VARCHAR(255),
    processing_time INT,
    processing_unit VARCHAR(10)
);

CREATE TABLE entry_restrictions (
    country_name VARCHAR(255),
    entry_restrictions TEXT
);
